DROP TABLE IF EXISTS `teacher`;
CREATE TABLE `teacher` (
  `id` varchar(32) NOT NULL COMMENT '教师id',
  `user_id` varchar(32) CHARACTER SET utf8mb4 DEFAULT NULL COMMENT '账户id',
  `job_number` varchar(20) DEFAULT NULL COMMENT '工号',
  `name` varchar(45) DEFAULT NULL COMMENT '名字',
  `sex` char(1) DEFAULT NULL COMMENT '性别（M：男 F：女）',
  `avatar` varchar(255) DEFAULT NULL COMMENT '头像',
  `birthday` datetime DEFAULT NULL COMMENT '生日',
  `nationality` varchar(20) DEFAULT NULL COMMENT '民族',
  `native_place` varchar(100) DEFAULT NULL COMMENT '籍贯',
  `political` varchar(20) DEFAULT NULL COMMENT '政治面貌',
  `marriage_status` tinyint(1) DEFAULT NULL COMMENT '婚姻状况：0 未婚 ，1：已婚',
  `education` varchar(20) DEFAULT NULL COMMENT '学历',
  `graduate_school` varchar(20) DEFAULT NULL COMMENT '毕业学校',
