  `certificate_type` varchar(20) DEFAULT NULL COMMENT '证件类型',
  `certificate_num` varchar(20) CHARACTER SET utf8mb4 DEFAULT NULL COMMENT '证件号码',
  `phone` varchar(45) DEFAULT NULL COMMENT '电话',
  `email` varchar(80) DEFAULT NULL COMMENT '电子邮件',
  `address` varchar(100) DEFAULT NULL COMMENT '家庭地址',
  `dept_id` varchar(20) DEFAULT NULL COMMENT '部门',
  `role_id` varchar(20) CHARACTER SET utf8mb4 DEFAULT NULL COMMENT '系统角色id',
  `job` varchar(20) DEFAULT NULL COMMENT '职位',
  `title` varchar(20) DEFAULT NULL COMMENT '职称',
  `employee_type` tinyint(1) DEFAULT NULL COMMENT '员工类型 1：编制 2：合同 3：临时 4：外聘',
  `join_job_time` datetime DEFAULT NULL COMMENT '加入工作时间',
  `join_campus_time` datetime DEFAULT NULL COMMENT '加入本校时间',
